        function descargarbalance() {

            var canvas = document.getElementById('balance');
            var imgData = canvas.toDataURL('imagen/png');
            var imgData2 =
                'data:image/png;base64, ';
            var newWidth = 800;
            var newHeight = 120;
            var quality = 1.0;
            var canvas2 = document.createElement('canvas');
            canvas2.width = newWidth;
            canvas2.height = newHeight;
            var context = canvas2.getContext('2d');
            var image = new Image();
            image.onload = function() {
                context.drawImage(image, 0, 0, newWidth, newHeight);
                var imgData2 = canvas2.toDataURL('image/png', quality);
                var doc = new jsPDF();
                var imgWidth = 190; // Ancho de la página del PDF en mm
                var pageHeight = 295; // Altura de la página del PDF en mm
                var imgHeight = canvas.height * imgWidth / canvas.width;
                var heightLeft = imgHeight;
                var position = 0;
                var imgRatio = canvas.width / canvas.height;
                while (heightLeft > 0) {
                    var width = imgWidth;
                    var height = width / imgRatio;
                    if (heightLeft < height) {
                        height = heightLeft;
                        width = height * imgRatio;
                    }
                    doc.addImage(imgData, 'PNG', 10, 50, width, height);
                    heightLeft -= height;
                    position -= height;
                    if (heightLeft > 0) {
                        doc.addPage();
                        position = -pageHeight;
                    }
                    doc.addImage(imgData2, 'PNG', 0.5, 10);
                }
                doc.save('informebalance.pdf')
            }
            image.src = imgData2;
        }
